import jsPDF from 'jspdf';

// --- Embedded Assets ---
// Municipality Coat of Arms
const MUNICIPALITY_LOGO = "data:image/png;base64,";

export const addPDFHeader = (doc: jsPDF, title: string) => {
    const pageWidth = doc.internal.pageSize.width;
    const primaryColor = [22, 53, 92]; // #16355c (Deep Blue)
    const secondaryColor = [100, 116, 139]; // Slate 500

    // --- Header Configuration ---
    const logoX = 14;
    const logoY = 10;
    const logoWidth = 14;
    const logoHeight = 17; // Aspect ratio for typical coat of arms

    // Draw Logo (Image)
    try {
        doc.addImage(MUNICIPALITY_LOGO, 'PNG', logoX, logoY, logoWidth, logoHeight);
    } catch (e) {
        console.warn('Error adding logo to PDF:', e);
    }

    // --- Header Text ---
    const textOffsetX = logoX + logoWidth + 5;

    // System Name / Municipality Name
    doc.setFontSize(16);
    doc.setTextColor(primaryColor[0], primaryColor[1], primaryColor[2]);
    doc.setFont('helvetica', 'bold');
    doc.text('S\u00E3o Francisco de Paula', textOffsetX, logoY + 6);

    // System Subtitle
    doc.setFontSize(8);
    doc.setTextColor(secondaryColor[0], secondaryColor[1], secondaryColor[2]);
    doc.setFont('helvetica', 'bold');
    doc.text('PREFEITURA MUNICIPAL', textOffsetX, logoY + 10);
    doc.setFont('helvetica', 'normal');
    doc.text('Gest\u00E3o Integrada Alicerce', textOffsetX, logoY + 14);

    // Municipality Info (Right Aligned)
    doc.setFontSize(8);
    doc.setTextColor(100, 100, 100);
    doc.setFont('helvetica', 'bold');
    doc.text('Estado do Rio Grande do Sul', pageWidth - 14, logoY + 6, { align: 'right' });
    doc.setFont('helvetica', 'normal');
    
    // Decorative Line
    doc.setDrawColor(200, 200, 200);
    doc.setLineWidth(0.5);
    doc.line(14, logoY + 20, pageWidth - 14, logoY + 20);

    // --- Report Title ---
    doc.setFontSize(14);
    doc.setTextColor(primaryColor[0], primaryColor[1], primaryColor[2]);
    doc.setFont('helvetica', 'bold');
    doc.text(title, 14, logoY + 28);
};

export const addPDFFooter = (doc: jsPDF) => {
    const pageCount = (doc as any).internal.getNumberOfPages();
    const pageWidth = doc.internal.pageSize.width;
    const pageHeight = doc.internal.pageSize.height;

    for (let i = 1; i <= pageCount; i++) {
        doc.setPage(i);
        
        // Footer Line
        doc.setDrawColor(200, 200, 200);
        doc.line(14, pageHeight - 14, pageWidth - 14, pageHeight - 14);

        // Footer Text
        doc.setFontSize(8);
        doc.setTextColor(150, 150, 150);
        
        // Left: System Info
        doc.text('Alicerce v1.2.6 - Sistema de Gest\u00E3o', 14, pageHeight - 10);

        // Center: Timestamp
        const now = new Date().toLocaleString('pt-BR');
        doc.text(`Gerado em: ${now}`, pageWidth / 2, pageHeight - 10, { align: 'center' });

        // Right: Page Number
        doc.text(`P\u00E1gina ${i} de ${pageCount}`, pageWidth - 14, pageHeight - 10, { align: 'right' });
    }
};
